import React from "react";
import { AiOutlineDoubleLeft, AiOutlineDoubleRight } from "react-icons/ai";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
export default function CarouselCardsComponent() {
  const settings = {
    dots: false,
    infinite: false,
    speed: 1000,
    slidesToShow: 6,
    slidesToScroll: 6,
    // rtl: true,
    prevArrow: (
      <AiOutlineDoubleLeft className="click_color  color-primary-xlight" />
    ),
    nextArrow: (
      <AiOutlineDoubleRight className="click_color  color-primary-xlight" />
    ),
    responsive: [
      {
        breakpoint: 1200,
        settings: {
          slidesToShow: 6,
          slidesToScroll: 6,
        },
      },
      {
        breakpoint: 600,
        settings: {
          slidesToShow: 3,
          slidesToShow: 3,
        },
      },
      {
        breakpoint: 480,
        settings: {
          slidesToShow: 2,
          slidesToScroll: 2,
        },
      },
    ],
  };
  return (
    <div>
      <h4>ffffffffffff</h4>
      <Slider {...settings}>
        <div>ddd</div>
        <div>kkkk</div>
        <div>yyyy</div>
        <div>ddd</div>
        <div>ddd</div>
        <div>rrrr</div>
        <div>uuu</div>
        <div>eeee</div> <div>kkkk</div>
        <div>yyyy</div>
        {/* {props.players.players.map((player) => (
          <Col xs={12} key={player.id}>
            <Link to={"/player-details/" + player.id}>
       
            </Link>
          </Col>
        ))} */}
      </Slider>
    </div>
  );
}
